import { ClientsSection } from "./ClientsSection";
import { FeaturedProductsSection } from "./FeaturedProductsSection";
import { FooterSection } from "./FooterSection";
import { HeaderSection } from "./HeaderSection";
import { WelcomeSection } from "./WelcomeSection";

export const Homepage = () => {
  const featuredProducts = [
    {
      id: 1,
      title: "Dosing System",
      top: "2835px",
      left: "130px",
      labelTop: "3246px",
      labelLeft: "152px",
    },
    {
      id: 2,
      title: "Seal auxiliary systems",
      top: "2835px",
      left: "632px",
      labelTop: "3246px",
      labelLeft: "654px",
    },
    {
      id: 3,
      title: "Control & Instrumentation",
      top: "2835px",
      left: "1134px",
      labelTop: "3246px",
      labelLeft: "1156px",
    },
    {
      id: 4,
      title: "Lube Oil Systems",
      top: "3339px",
      left: "342px",
      labelTop: "3750px",
      labelLeft: "364px",
    },
    {
      id: 5,
      title: "Fuel Oil Systems",
      top: "3339px",
      left: "844px",
      labelTop: "3750px",
      labelLeft: "866px",
    },
  ];

  const clientBoxes = [
    { id: 1, left: "119px" },
    { id: 2, left: "503px" },
    { id: 3, left: "887px" },
    { id: 4, left: "1271px" },
  ];

  return (
    <div className="bg-white w-full min-w-[1728px] h-[5850px] relative">
      {/* Yellow background section */}
      <div className="absolute top-[3955px] left-0 w-[1728px] h-[1220px] bg-[#eec755]" />
      
      {/* Hero background image placeholder */}
      <div className="absolute top-0 left-0 w-[1728px] h-[1117px] bg-gradient-to-b from-gray-900 to-gray-700" />
      
      <HeaderSection />
      <WelcomeSection />
      <FeaturedProductsSection />
      
      {/* Featured Products Title */}
      <p className="absolute top-[2682px] left-[calc(50.00%_-_742px)] w-[1441px] h-[49px] flex items-center justify-center font-extrabold text-transparent text-[75px] tracking-[0] leading-[43px] whitespace-nowrap">
        <span className="text-black">Featured </span>
        <span className="text-[#fbcc00]">Products</span>
      </p>

      {/* Featured Products Line */}
      <div className="absolute top-[2780px] left-[122px] w-[1484px] h-[3px] bg-gray-300" />

      {/* Featured Products Images Placeholders */}
      {featuredProducts.map((product) => (
        <div
          key={product.id}
          className="absolute w-[472px] h-[472px] bg-gray-200 rounded-lg flex items-center justify-center"
          style={{ top: product.top, left: product.left }}
        >
          <span className="text-gray-500 text-lg">{product.title}</span>
        </div>
      ))}

      {/* Featured Products Labels */}
      {featuredProducts.map((product) => {
        const labelWidth =
          product.title === "Dosing System"
            ? "222px"
            : product.title === "Lube Oil Systems"
            ? "248px"
            : product.title === "Seal auxiliary systems"
            ? "304px"
            : product.title === "Fuel Oil Systems"
            ? "239px"
            : "344px";

        const textWidth =
          product.title === "Dosing System"
            ? "172px"
            : product.title === "Lube Oil Systems"
            ? "198px"
            : product.title === "Seal auxiliary systems"
            ? "254px"
            : product.title === "Fuel Oil Systems"
            ? "189px"
            : "294px";

        return (
          <div
            key={`label-${product.id}`}
            className="absolute h-[39px] flex gap-[9.4px]"
            style={{
              top: product.labelTop,
              left: product.labelLeft,
              width: labelWidth,
            }}
          >
            <div className="w-[38.62px] h-[38.62px] bg-[#fbcc00] rounded-[7.13px]" />
            <div
              className="flex items-center justify-center mt-[9.9px] h-[18px] font-semibold text-white text-[23.5px] tracking-[0] leading-[17.2px] whitespace-nowrap"
              style={{
                width: textWidth,
                marginTop: product.title === "Dosing System" ? "9.9px" : "10.4px",
              }}
            >
              {product.title}
            </div>
          </div>
        );
      })}

      <ClientsSection />

      {/* Clients Line */}
      <div className="absolute top-[4742px] left-[121px] w-[1487px] h-[3px] bg-gray-300" />

      {/* Industrial Image Placeholder */}
      <div className="absolute top-[3971px] left-[704px] w-[1024px] h-[743px] bg-gray-300 rounded-lg flex items-center justify-center">
        <span className="text-gray-600 text-xl">Industrial Equipment</span>
      </div>

      {/* Client Boxes */}
      {clientBoxes.map((box) => (
        <div
          key={box.id}
          className="absolute top-[4844px] w-[338px] h-[178px] bg-white rounded-[18px] shadow-lg flex items-center justify-center"
          style={{ left: box.left }}
        >
          <span className="text-gray-400">Client Logo {box.id}</span>
        </div>
      ))}

      {/* Group indicator */}
      <div className="absolute top-[5074px] left-[calc(50.00%_-_92px)] w-[183px] h-4 bg-gray-300 rounded" />

      {/* Footer background */}
      <div className="absolute top-[5175px] left-0 w-[1728px] h-[675px] bg-[#0e0e0e]" />

      {/* Company logo placeholder */}
      <div className="top-[5272px] left-[98px] absolute w-[391px] h-[111px] bg-gray-700 rounded flex items-center justify-center">
        <span className="text-white">PSI Logo</span>
      </div>

      {/* Footer line */}
      <div className="absolute top-[5753px] left-[calc(50.00%_-_766px)] w-[1522px] h-1 bg-gray-600" />

      {/* Copyright */}
      <p className="absolute top-[5785px] left-[calc(50.00%_-_249px)] font-normal text-white text-xl text-center tracking-[0] leading-[35px] whitespace-nowrap">
        © Copyright ©2025 PSI. All Rights Reserved Copyright
      </p>

      <FooterSection />

      {/* Footer description */}
      <p className="absolute top-[5423px] left-[calc(50.00%_-_766px)] w-[670px] font-medium text-[#ffffff99] text-[25px] tracking-[0] leading-[36.0px]">
        We design and deliver reliable auxiliary systems for oil & gas,
        power, and process industries—ensuring efficiency, safety, and
        uninterrupted operations across every stage of your plant.
      </p>

      {/* Social Icons */}
      <div className="absolute top-[5614px] left-[98px] w-[388px] h-[49px] flex gap-[64.5px]">
        <div className="w-[48.67px] h-[48.67px] bg-gray-600 rounded-full flex items-center justify-center">
          <span className="text-white text-xs">FB</span>
        </div>
        <div className="w-[48.67px] h-[48.67px] bg-gray-600 rounded-full flex items-center justify-center">
          <span className="text-white text-xs">TW</span>
        </div>
        <div className="w-[48.67px] h-[48.67px] bg-gray-600 rounded-full flex items-center justify-center">
          <span className="text-white text-xs">IN</span>
        </div>
        <div className="w-[48.67px] h-[48.67px] bg-gray-600 rounded-full flex items-center justify-center">
          <span className="text-white text-xs">YT</span>
        </div>
      </div>
    </div>
  );
};
